import ReactDOM from 'react-dom';

class Classes extends  React.Component{
    constructor(props){
        super(props);
        this.state = {
            clist: []
        };
    }

    componentDidMount(){
        fetch('https://6079395e460a6600174fb472.mockapi.io/api/v1/teacher')
        .then(res => res.json())
        .then((data) => {
          this.setState({ items: data })
        })
        .catch(console.log) 
    }

    render(){
        return(<h1>Classes</h1>);
    }
}

export default Classes;
